import React from "react";
import space from "../images/space.jpg";
import earth from "../images/earth.png";
import moon from "../images/moon.png";
import { useInView } from "react-intersection-observer";

export default function ParallaxEffect() {
  const { ref: myRef, inView } = useInView();
  return (
    <div className="parallaxContainer" ref={myRef}>
      <img src={space} alt="Space" className="background"></img>
      <img src={earth} alt="Earth" className="midground"></img>
      <img src={moon} alt="Moon" className="foreground"></img>
      <h1 className="parallaxTitle">
        Together we can create and explore the Universe!
      </h1>
      <div></div>
    </div>
  );
}
